import React from 'react';
import './App.css';
import List from './List'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Welcome to this react App. 
      </header>
      <h1>Favorite Movies</h1>
      <List/>
      <h1>Movies I want to watch</h1>
      <List/>
    </div>
  );
}

export default App;
